INSERT INTO `CIIU_V3` VALUES (0,'Arrendamiento de propiedad intelectual y productos similares excepto derechos de autor'),(111,'Cultivo de cereales y otros cultivos n.c.p (ej. algodon, semillas oleaginosas, remolacha azucarera, caña azucarera, papas, tabaco, pastos forrajeros, etc.).'),(112,'Cultivo de hortalizas y legumbres, recoleccion de hongos y trufas, pimientos, hortalizas como perejil, estragon y otras, productos de vivero, como por ej., plantas para transplante y ornamentacion.'),(113,'Cultivo de arboles frutales, pequeñas frutas, uvas y plantas cuyas hojas o frutas se utilizan para preparar bebidas y especias. Incluye la elaboracion de vino cuando se realiza en el mismo lugar en que se cultiva la uva.'),(121,'Cria de ganado vacuno, ovino, caballar, cabras.'),(122,'Cria de pollos.'),(123,'Cria de cerdos.'),(129,'Cria de otros animales n.c.p.'),(130,'Cultivo de productos agricolas en combinacion con la cria de animales (explotacion mixta)'),(140,'Servicios agricolas y ganaderos excepto los servicios veterinarios. (Plantacion, cuidado de cultivos, proteccion contra enfermedades e insectos, recoleccion de cosechas, desmotado de algodon. Preparacion de los productos para su comercializacion. Diseños paisajistas para plantios.Conservacion de prados. Manejo del sistema de riego. Albergue, cuidado y reproduccion de animales, inseminacion artificial, esquila de ovejas, etc..).'),(150,'Caza ordinaria y mediante trampas y repoblacion de animales de caza y servicios conexos. Produccion de pieles finas, cueros de reptiles y plumas de aves. Reproduccion de animales de caza.'),(200,'Silvicultura, extraccion de madera y servicios conexos. (Lucha contra incendios, servicios de corte, transporte de troncos, inventario de existencias maderables, etc.).'),(500,'Pesca, explotacion de criaderos de peces'),(1000,'Extraccion de carbon, lignito y turba (fabricacion de briquetas).'),(1110,'Extraccion de petroleo crudo y gas natural. Produccion de hidrocarburos. (Incluye la perforacion y terminacion de pozos, cuando no son realizados por terceros)'),(1120,'Servicios relacionados con la extraccion de petroleo y gas. (Perforacion inicial, ereccion de torres, cementacion, taponamiento y abandono de pozos a cambio de una retribucion o por contrata).'),(1200,'Extraccion de minerales de uranio y torio.'),(1310,'Extraccion de minerales de hierro.'),(1320,'Extraccion de minerales metaliferos no ferrosos.'),(1411,'Extraccion de balasto, arena, arcilla y canto rodado.'),(1412,'Extraccion de piedra caliza (caleras).'),(1413,'Canteras de marmol y granito.'),(1419,'Extraccion de yeso.'),(1420,'Explotacion de minas y canteras.'),(1421,'Extraccion de mineral para la fabricacion de abonos y productos quimicos. Recoleccion de guano.'),(1422,'Extraccion de sal.'),(1423,'Extraccion de gemas naturales.'),(1429,'Minas y canteras de asbesto, mica, cuarzo, abrasivos naturales distintos de la arena, grafito, talco, asfaltos y betunes, turba y demas minerales no metalicos n.c.p.. La molienda, trituracion, pulverizacion etc. de estos minerales, se incluyen en este grupo cuando se realizan simultaneamente con la extraccion.'),(1511,'Matanza de ganado (vacuno, ovino, caballar y porcino) y de otros animales. Preparacion y conservacion de carnes.'),(1512,'Elaboracion y conservacion de pescado y productos de pescado.'),(1513,'Elaboracion y conservacion de frutas, legumbres y hortalizas.'),(1514,'Elaboracion de aceites y grasas de origen vegetal y animal.'),(1520,'Elaboracion de productos lacteos.'),(1530,'Elaboracion de productos de molineria, almidones y productos derivados del almidon y de alimentos preparados para animales.'),(1531,'Molinos harineros. Molienda de cereales, elaboracion de alimentos mediante el tostado, insuflacion, etc..'),(1532,'Elaboracion de almidones de arroz, maiz, patata, yuca y productos derivados del almidon. Molienda de maiz humedo. Elaboracion de aceite de maiz, gluten y glucosa.'),(1533,'Elaboracion de alimentos preparados para animales (los subproductos que sirven de alimento para animales sin tratamiento posterior, se clasifican en las industrias que los originan).'),(1534,'Molinos arroceros.'),(1541,'Elaboracion de productos de panaderia.'),(1542,'Elaboracion de azucar de caña y de remolacha. Elaboracion de sacarosa.'),(1543,'Elaboracion de cacao, chocolate y productos de chocolate, caramelos, pastillas, confites, goma de mascar. Frutas y cascaras abrillantadas.'),(1544,'Fiderias y fabricacion de pastas frescas.'),(1549,'Elaboracion de otros productos alimenticios n.c.p. (sopas y jugos concentrados, alimentos a base de nueces, cafe, miel, te, especies, condimentos, vinagres, levadura y productos a base de huevo). Extractos de carne, pescado y legumbres. Yerba mate.'),(1551,'Destilacion, rectificacion y mezcla de bebidas espirituosas. Alcohol etilico.'),(1552,'Elaboracion de vinos.'),(1553,'Cervecerias y fabricacion de maltas.'),(1554,'Fabricacion de bebidas sin alcohol y aguas de mesa minerales o no.'),(1600,'Industria del tabaco.'),(1710,'Hilanderia, tejeduria, acabado de productos textiles, lavaderos y fabricacion de tops.'),(1711,'Hilanderia, tejeduria y acabado de lana, algodon, sintetico y fibras duras. Se incluye el teñido cuando este se realiza en la misma unidad de produccion del hilado o tejido. Incluye tejidos de fibra de vidrio.'),(1712,'Acabado de productos textiles (blanqueo, teñido, etc., cuando no se produce en la misma unidad en que se hace el tejido o el hilado).'),(1713,'Lavaderos y fabricacion de tops.'),(1720,'Fabricacion de otros productos textiles con tejidos no producidos en la misma unidad. (Cuando los articulos se fabrican en la misma unidad que produce los tejidos, la actividad se considera auxiliar de la tejeduria). Incluye fabricacion de toallas, frazadas, toldos, cortinas, redes, alfombras, articulos de pasamaneria, tejidos recubiertos de plastico, guatas, camisas para mecheros, cuerdas, cordeles, hilos de fibras textiles recubiertos o no con caucho o plastico, etc..'),(1730,'Fabricacion de tejidos de punto como buzos, chalecos, camisetas, medias y similares. Se incluyen prendas de vestir cuando los tejidos se producen en la misma unidad.'),(1810,'Fabricacion de prendas de vestir, con materiales no fabricados en la misma unidad, excepto prendas de piel. Incluye la fabricacion de prendas de tela, otros materiales textiles y de cuero. Ropa interior y exterior, y accesorios como guantes, cinturones, sombreros, redecillas para el pelo, excepto calzado.'),(1820,'Fabricacion de pieles finas y de articulos de pieles finas (excepto calzado). Incluye fabricacion de prendas de vestir de piel y teñido de pieles finas. Incluye fabricacion de articulos con pieles artificiales.'),(1911,'Curtiembres y talleres de acabado.'),(1912,'Fabricacion de maletas, bolsos de mano y otros articulos de cuero. Tambien se incluye la fabricacion de maletas, bolsos de mano y articulos similares confeccionados con otros materiales (imitacion cuero) tales como plastico, fibras vulcanizadas, etc.'),(1920,'Fabricacion de calzado de cualquier material y para todo uso.'),(2010,'Aserraderos, acabado de madera, fabricacion de parquet.'),(2021,'Fabricacion de productos de madera, excepto muebles. Carpinteria de obra blanca. Incluye tambien la fabricacion de hojas y tablas de madera, hojas de madera enchapada, otros productos de madera laminada. Fabricacion de recipientes de madera, jaulas.'),(2101,'Fabricacion de pulpa de madera, papel y carton.'),(2102,'Fabricacion de papel y carton ondulado y de envases de papel y carton.'),(2109,'Fabricacion de articulos de papel y carton (papel carbonico, papel para fotocopia sobres, postales, carpetas, papel higienico, toallas, servilletas, tampones, toallas higienicas, y otros articulos como bandejas, platos y vasos, etc.)'),(2210,'Actividades de encuadernación, impresion, edicion, grabacion y reproducción sobre papel.'),(2211,'Actividades de encuadernacion, impresion, edicion, grabacion y reproduccion sobre papel, excepto diarios y revistas. Incluye libros, tarjetas postales, folletos, etc..'),(2212,'Impresion y edicion de diarios y revistas.'),(2029,'Fabricacion de articulos de corcho, paja y materiales trenzables (caña, mimbre, etc., excepto muebles que no sean empotrados). Incluye herramientas, hormas, adornos, percheros, carretes, armarios de cocina y otros muebles empotrados, planchas de corcho, cestos de mimbre, etc..'),(2230,'Edicion y reproduccion de grabaciones en discos gramofonicos, cintas magnetofonicas, videocintas y cintas de computadores a partir de grabaciones originales. Reproduccion de discos flexibles y duros de computadores, duplicacion de filmes y otros medios de reproduccion sonora.'),(2310,'Fabricacion de materiales para pavimentacion y techado a base de asfalto. Fabricacion de briquetas de combustible y combustible aglomerado de carbon o lignito comprados y aceites y grasas lubricantes, compuestos y mezclas preparadas con materiales comprados.'),(2320,'Produccion de combustibles, aceites grasas lubricantes, productos bituminosos y otros productos derivados del petroleo como etano, butano y propano.'),(2330,'Produccion de combustible nuclear.'),(2411,'Fabricacion de sustancias quimicas basicas (excepto abonos y compuestos de nitrogeno): gases industriales y elementales, acidos inorganicos excepto acido nitrico, sustancias quimicas inorganicas como hidrocarburos, benceno y otros productos de la destilacion del alquitran de hulla y de aceite mineral, alcoholes (excepto alcohol etilico), colorantes de origen vegetal, animal y sinteticos, curtientes sinteticos, etc..'),(2412,'Fabricacion de abonos. Se incluye la fabricacion de urea y abonos nitrogenados, fosfatados y potasicos.'),(2413,'Fabricacion de plasticos en formas primarias, caucho sintetico, resinas sinteticas y fibras artificiales.'),(2421,'Fabricacion de plaguicidas y otros productos quimicos de uso agropecuario. (Insecticidas, raticidas, fungicidas, reguladores del crecimiento de las plantas, herbicidas, desinfectantes, etc.).'),(2422,'Fabricacion de pintura, barnices, lacas, masillas, disolventes, removedores de pintura, tintas para imprenta, oleos, pasteles, crayolas, pinturas para artistas.'),(2423,'Fabricacion de productos farmaceuticos y medicamentos para uso medico y veterinario. (Apositos, vendajes, cementos dentales, productos botanicos).'),(2424,'Fabricacion de jabones, articulos de limpieza, articulos de tocador y preparados para pulir y limpiar (bruñidores, pomada para calzado, polvos abrasivos, ceras, glicerina, etc.).'),(2429,'Fabricacion de explosivos, articulos pirotecnicos, fosforos, adhesivos, aceites esenciales, polvos y pastas para soldadura, aditivos para aceites lubricantes, tinta para escribir, municiones, papel radiografico, fotografico y heliografico. Material para grabaciones sonoras y de otro tipo. Fabricacion de otros productos quimicos n.c.p., como preparados anticongelantes, carbon activado, pasta para calzado, etc. Refinacion de sal comestible.'),(2430,'Hilanderia y tejeduria de fibras artificiales compradas. Fabricacion de fibras discontinuas, estopas de filamentos artificiales excepto vidrio.'),(2511,'Fabricacion de camaras y neumaticos. Recauchutaje.'),(2519,'Fabricacion de productos de caucho natural o sintetico en formas basicas (planchas, varillas, tubos, mangueras, regatones, productos para revestimientos de pisos, etc.). Fabricacion de materiales para la reparacion de camaras.'),(2520,'Fabricacion de productos de plastico. Se incluyen los productos de tejido de plastico, excepto prendas de vestir. Incluye la fabricacion de cortinas de enrollar y ventanas de plastico y su colocacion por los fabricantes. Tambien recubrimientos para pisos en rollos y en losetas .Se excluye la fabricacion de instrumentos cientificos, colchones de plastico, juegos, juguetes, que se declaran en las clases correspondientes a estas producciones.'),(2610,'Fabricacion de vidrio y productos de vidrio, excepto el material medico e instrumentos opticos y fotograficos de este material. Fabricacion de fibra de vidrio y productos de fibra de vidrio.'),(2690,'Fabricacion de productos minerales no metalicos n.c.p..'),(2691,'Fabricacion de objetos de barro, loza, ceramica para uso no estructural.'),(2692,'Fabricacion de productos de arcilla y ceramica refractaria o no refractaria para la construccion y otros productos refractarios sin contenido de arcilla.'),(2694,'Fabricacion de cemento, cal y yeso.'),(2695,'Fabricacion de articulos de cemento, hormigon y yeso.'),(2699,'Corte, tallado y acabado de la piedra. Fabricacion de otros productos minerales no metalicos n.c.p. (marmolerias). Se incluye la fabricacion de hilados y tela de asbesto, materiales aislantes de origen mineral, productos de lana de vidrio para aislamiento termico, productos de asfalto y similares, muelas de molinos, piedras de afilar, polvos abrasivos, articulos de mica y de grafito que no sean articulos electricos, etc..'),(2700,'Industrias basicas de hierro, acero y metales no ferrosos.'),(2811,'Fabricacion de productos metalicos estructurales (herreria de obra) principalmente de hierro, acero o aluminio. La colocacion de estructuras metalicas por sus fabricantes se incluye en esta clase.'),(2812,'Fabricacion de recipientes de metal: tanques, depositos y otros recipientes utilizados para almacenamiento, radiadores y generadores de vapor (incluye fabricacion de calderas de agua caliente para calefaccion central).'),(2890,'Fabricacion de otros productos de metal. Incluye tratamientos especiales como impresion, bruñido, pulido, prensado, laminado'),(2910,'Fabricacion de maquinaria de uso general: motores, turbinas, (excepto motores de aeronaves, vehiculos automotores y bicicletas). Fabricacion de bombas, compresores, grifos de metal, cojinetes, engranajes, hornos y quemadores, generadores, equipos de manipulacion y elevacion'),(2920,'Fabricacion de maquinaria de uso especial (para el agro, la mineria, la construccion y la industria manufacturera). Fabricacion de armas, municiones y explosivos'),(2930,'Fabricacion de electrodomesticos tales como refrigeradores, lavarropas, cocinas, calefones, etc..'),(3000,'Fabricacion de maquinaria de oficina, contabilidad e informatica.'),(3100,'Fabricacion de motores, generadores, transformadores electricos, cargadores de baterias, aparatos de distribucion y control de energia electrica'),(3200,'Fabricacion de tubos, valvulas electronicas, diodos y otros componentes electronicos, trasmisores de radio, television y aparatos para telefonia y telegrafia con hilos'),(3300,'Fabricacion de aparatos e instrumentos medicos, aparatos para medir, verificar, ensayar, navegar y otros fines. (Balanzas de precision, microscopios, tornos para dentistas, electrocardiografos, instrumentos de dibujo, contadores de consumo de electricidad, agua y gas, aparatos de radar y control remoto, termostatos, etc.). Fabricacion de equipos de control para procesos industriales. Fabricacion de instrumentos de optica y equipos fotograficos. Fabricacion de relojes, pulseras de metal precioso, rubies y otras piezas para relojes. Incluye muebles y accesorios de uso medico y fabricacion de aparatos protesicos y ortopedicos.'),(3400,'Fabricacion de vehiculos automotores, carrocerias, cupulas, repuestos y sus motores y contenedores.'),(3500,'Reparacion de equipo de transporte, excepto los vehiculos automotores'),(3510,'Construccion y reparacion de buques y otras embarcaciones. Se incluyen embarcaciones cuyo uso no es la navegacion, como dragas, plataformas de perforacion, diques flotantes. Mantenimiento, reparacion y desguazamiento de embarcaciones.'),(3520,'Fabricacion de locomotoras y material rodante para ferrocarriles y tranvias.'),(3530,'Fabricacion de aeronaves y naves espaciales.'),(3590,'Fabricacion de motocicletas, bicicletas, sillones de ruedas y otro tipo de transporte n.c.p., (carretillas, montacargas y otros vehiculos de propulsion manual o animal).'),(3600,'Otras industrias manufactureras n.c.p.'),(3610,'Fabricacion de muebles de todo tipo y de colchones de cualquier material.'),(3691,'Fabricacion de joyas con piedras preciosas o semipreciosas y metales preciosos y articulos conexos de orfebreria como vajilla, cubiertos, monedas y otros.'),(3699,'Fabricacion de instrumentos de musica, articulos de deportes, juegos, juguetes, linoleo etc. fabricacion de velas, lapices, flores artificiales, paraguas, joyas de fantasia, encendedores, lapices, minas para lapices, pipas, peines, pelucas, escobas, cepillos, plumeros, pinceles, rodillos para pintura, maquinas de juegos mecanicos y accionadas por monedas, etc.'),(3700,'Reciclaje de desperdicios y desechos metalicos y no metalicos.'),(4010,'Generacion, captacion y distribucion de energia electrica.'),(4020,'Produccion y distribucion de gas.'),(4030,'Suministro de vapor y agua caliente.'),(4100,'Captacion, depuracion y distribucion de agua.'),(4500,'Construccion'),(4510,'Preparacion del terreno. Demolicion.'),(4521,'Obras de ingenieria. Incluye instalacion de estructuras de metal, e hormigon armado, de madera, de plastico. Construccion y reparacion de vias ferreas, muelles, diques, escolleras, tuneles, aeropuertos, hangares. Colocacion de redes de servicios electricos, telefonicos, de alcantarillado, saneamiento, de agua potable y de fluidos en general. Construccion y reparacion de plantas de tratamiento de agua potable, de aguas servidas, canchas de deportes, piletas de natacion, infraestructuras de plazas, parques y jardines publicos. Construccion y reparacion de estadios deportivos, represas, tajamares, atajos, regadios, muros de contencion, tanques para fluidos y pozos profundos.'),(4522,'Obras de vialidad. Incluye construccion y reparacion de autopistas, rutas, carreteras, caminos, calles, veredas, alcantarillas, pavimentos en general, puentes, pistas de aeropuertos y pistas para omnibus.'),(4523,'Obras de arquitectura. Construccion y reparacion de edificios. Construccion y reparacion de edificios funerarios.'),(4530,'Acondicionamiento de edificios.'),(4531,'Instalacion y reparacion de antenas, sistemas de alarmas, sistemas de extension de incendios, sistemas de calefaccion y aire acondicionado, ascensores. Instalaciones y reparaciones electricas en general.'),(4532,'Instalaciones y reparaciones sanitarias. Plomeria.'),(4540,'Terminacion de edificios. Terminacion de frentes, colocacion de andamios, pintura, impermeabilizacion de azoteas, colocacion de pisos en general, etc. Se incluyen las reparaciones relacionadas con estas actividades.'),(4550,'Alquiler de equipo de construccion y demolicion dotado de operarios.'),(5000,'Comercio al por mayor y al por menor de vehiculos automotores.'),(5010,'Comercio de vehiculos automotores de pasajeros y especiales como ambulancias, omnibuses, casas rodantes, etc..'),(5020,'Mantenimiento y reparacion de vehiculos automotores. Talleres mecanicos. Talleres de chapa y pintura. Gomerias y lavaderos de autos (cuando no son parte de una estacion de servicio.'),(5030,'Comercio de partes, piezas y accesorios de vehiculos automotores. Incluye la venta al por mayor y al por menor.'),(5040,'Comercio, mantenimiento y reparacion de motocicletas y de sus partes, piezas y accesorios. Incluye la venta al por mayor y por menor.'),(5050,'Comercio al por menor de combustibles para automotores. Estaciones de servicio. Incluye comercio de lubricantes, repuestos de vehiculos, gomeria y lavado de autos cuando son parte de la estacion de servicio.'),(5110,'Comercio al por mayor a cambio de una retribucion o por contrato en nombre o por cuenta de terceros (comisionistas, consignatarios, subastadores, corredores).'),(5121,'Comercio al por mayor de materias primas agropecuarias y de animales vivos. Incluye tambien la venta de flores, plantas, pieles, cueros, etc..'),(5122,'Comercio al por mayor de alimentos bebidas y tabacos.'),(5131,'Comercio al por mayor de productos textiles, prendas de vestir y calzado.'),(5139,'Comercio al por mayor de otros enseres domesticos (bazar, productos farmaceuticos, perfumeria, articulos fotograficos y opticos, juegos, juguetes, articulos de cuero y accesorios de viaje, relojes, articulos de joyeria, articulos deportivos incluso bicicletas). Muebles para el hogar y la oficina. Aparatos de radio y television. Instrumentos quirurgicos y ortopedicos. Utiles'),(5141,'Comercio al por mayor de combustibles solidos, liquidos, gaseosos y de productos conexos.'),(5142,'Comercio al por mayor de metales y minerales metaliferos.'),(5143,'Comercio al por mayor de materiales de construccion, articulos de ferreteria y materiales de sanitaria y calefaccion.'),(5149,'Comercio al por mayor de sustancias quimicas basicas, materiales plasticos en forma primaria, fibras textiles y materiales para reciclamiento. Comercio al por mayor de otros productos intermedios, desperdicios y desechos.'),(5150,'Comercio al por mayor de maquinaria, equipo y materiales (para la industria, el comercio y el agro).'),(5190,'Comercio al por mayor de otros productos (no incluidos en las clases anteriores).'),(5210,'Comercio al por menor en establecimientos donde se combina la venta de alimentos con la de otros productos tales como: ropa, electrodomesticos, articulos de bazar, muebles, juguetes, articulos deportivos, etc. Incluye supermercados, cooperativas de consumo, grandes almacenes, etc.'),(5220,'Comercio al por menor de alimentos, bebidas y tabaco en almacenes especializados (almacenes de comestibles, fiambrerias, carnicerias, venta de aves y huevos, pescaderias, verdulerias, venta de productos lacteos, panaderias, confiterias, etc.).'),(5231,'Comercio al por menor de productos farmaceuticos, medicinales, y ortopedicos, cosmeticos y articulos de tocador.'),(5232,'Comercio al por menor de productos textiles, prendas de vestir, calzado, y articulos de cuero y piel.'),(5233,'Comercio al por menor de aparatos, articulos y equipos de uso domestico (radio, television, vajilla, cortinas, muebles, equipos de musica, discos, artefactos de iluminacion, etc..)'),(5234,'Comercio al por menor de articulos de ferreteria, pintura, vidrios, y productos de vidrio, materiales de construccion.'),(5239,'Comercio al por menor de otros productos en almacenes especializados (libros, articulos de papeleria, articulos de limpieza, juguetes, relojes, plantas, garrafas de gas, reventa de programas de computacion, etc.).'),(5240,'Comercio al por menor de productos usados. Casas de empeño.'),(5251,'Comercio al por menor en empresas de ventas por correo, television, tarjetas de credito, etc..'),(5252,'Comercio al por menor en puestos callejeros y mercados.'),(5259,'Otro comercio al por menor, no realizado en almacenes, puestos de venta ni mercados (vendedores a domicilio, maquinas expendedoras.)'),(5260,'Reparacion de efectos personales y enseres domesticos, no relacionada con las actividades de fabricacion y venta al por mayor o al por menor. (Reparaciones de calzado, valijas, televisores, joyas, instrumentos de musica, camaras fotograficas y otras).'),(5510,'Hoteles, moteles, campamentos, hosterias, albergues para jovenes, casas de huespedes y otros tipos de hospedaje temporal.'),(5511,'Hoteles, pensiones, hosterias.'),(5512,'Casa de huespedes, hotel de alta rotatividad.'),(5513,'Camping y otros tipos de alojamientos temporales n.c.p..'),(5520,'Restoranes, bares y cantinas. Tambien se incluyen los servicios de coche comedor, si son proporcionados por unidades independientes de las empresas ferroviarias.'),(6010,'Transporte por via ferrea de pasajeros y carga.'),(6021,'Transporte regular de pasajeros. Transporte colectivo de pasajeros urbano, interdepartamental e internacional.'),(6022,'Transporte no regular de pasajeros (taximetros, remises, autobuses de excursion, escolares, alquiler de autos con conductor, etc.).'),(6023,'Transporte de carga por carretera.'),(6030,'Transporte por tuberias.'),(6110,'Transporte maritimo y de cabotaje de pasajeros y de carga.'),(6120,'Transporte por vias de navegacion interiores de pasajeros y de carga.'),(