ion de anuncios para los clientes en revistas, periodicos, television, carteles, publicidad aerea, distribucion de material y muestras de publicidad, etc..'),(7490,'Actividades empresariales n.c.p..'),(7491,'Obtencion y dotacion de personal. Comprende la busqueda, seleccion, recomendacion y colocacion de personal para empleos en distintos sectores.'),(7492,'Investigacion y seguridad de personas y de bienes. Incluye actividades de vigilancia, transporte de objetos de valor, medios de proteccion como perros guardianes, coches blindados, actividades de guardaespaldas, guardianes, serenos, actividades de detectives, identificacion dactiloscopica y caligrafica, adiestramiento de perros guardianes, etc..'),(7493,'Actividades de limpieza de edificios comerciales y residenciales. Incluye actividades de fumigacion, desinfeccion y exterminio, y la limpieza de frentes con arena u otroCasas medios.'),(7494,'de fotografia, laboratorios fotograficos. Incluye el procesamiento, revelado, impresion y ampliacion de fotografias.'),(7495,'Actividades de envase y empaque. Incluye el envase de productos farmaceuticos y cosmeticos, el rotulado, el estampado, etc..'),(7499,'Otras actividades empresariales n.c.p. Incluye actividades tales como: cobranza de cuentas, mecanografia, traduccion, diseño de telas, joyas, muebles, decoracion de interiores, actividades de exhibicion, de subasta, publicidad por correo, agencias de contratacion de actores para diversos espectaculos, etc..'),(7510,'Administracion del estado y aplicacion de la politica economica y social de la comunidad. Actividades administrativas de los gobiernos centrales, municipales o locales relacionadas con las fuerzas armadas, la policia, las dependencias legislativas, judiciales, de regulacion de las actividades de los organismos que prestan servicios sociales (salud, cultura, educacion,etc..), registros, asuntos exteriores, impuestos, estadisticas y politicas generales.'),(7520,'Actividades de relaciones exteriores, defensa y 